  false,\n\t\"url\": null,\n\t\"notes\": \"The Light Detection and Ranging (LiDAR)
  LAS dataset is a survey of select areas within Southwest Florida. These data were
  produced for the Southwest Florida Water Management District (SWFWMD). This metadata
  record describes the ortho & LIDAR mapping of Lake Hancock, in Polk County, FL.
  The mapping consists of LIDAR data collection, contour generation, and production
  of natural color orthophotography with a 1ft pixel using imagery collected with
  a Wild RC-30 Aerial Camera.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
